import React from 'react';

const ProductDetail = () => {
    const car = { id: 1, title: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' };

    const handleDelete = () => {
        // Logic to delete the car
        console.log(`Car with ID ${car.id} deleted`);
    };

    const handleEdit = () => {
        // Logic to edit the car
        console.log(`Car with ID ${car.id} edited`);
    };

    return (
        <div className="container mx-auto py-10 px-6 max-w-lg">
            <h1 className="text-3xl font-bold mb-8 text-gray-800 text-center">Car Details</h1>
            <div className="bg-white rounded-lg shadow-lg">
                <img src={car.imageUrl} alt={car.title} className="w-full h-64 object-cover rounded-t-lg" />
                <div className="p-6">
                    <h3 className="text-2xl font-semibold text-gray-800 mb-2">{car.title}</h3>
                    <p className="text-gray-600">{car.description}</p>
                    <div className="flex justify-end mt-4 space-x-4">
                        <button
                            onClick={handleEdit}
                            className="bg-yellow-500 text-white py-2 px-4 rounded-lg font-semibold hover:bg-yellow-600"
                        >
                            Edit
                        </button>
                        <button
                            onClick={handleDelete}
                            className="bg-red-500 text-white py-2 px-4 rounded-lg font-semibold hover:bg-red-600"
                        >
                            Delete
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ProductDetail;
